import React from "react";
import { Eye, Pencil, Play } from "react-bootstrap-icons";

export default function TableProjects(props: any) {
  return (
    <tbody>
      {props.data.map((item: any, index: number) => {
        return (
          <tr>
            <td style={{ textAlign: "center" }}>{index + 1}</td>
            <td style={{ textAlign: "center" }}>{item.name}</td>
            <td style={{ textAlign: "center" }}>
              {new Date(item.deadLine).toLocaleDateString("en-CA")}
            </td>
            <td style={{ textAlign: "center" }}>{item.timePerWeek}</td>
            <td style={{ textAlign: "center" }}>{item.TotalTimeSpent}</td>
            <td style={{ textAlign: "center" }}>{item.isCompleted}</td>
            <button type="button" className="btn btn-primary mb-2 mt-2">
              <Eye color="white" size={15} />
            </button>
            <button
              type="button"
              className="btn btn-success ml-2"
              onClick={() => props.editModal(item)}
            >
              <Pencil color="white" size={15} />
            </button>
            <button type="button" className="btn btn-danger ml-2">
              <Play color="white" size={15} />
            </button>
          </tr>
        );
      })}
    </tbody>
  );
}
